[75418904] = {id = 75418904, remark = "…リーダー。見ていたのかしら。", type = 1, option_ids = "0", next = 75418905, role_ids = "75200181:75210034", expression = "0", action = "0", action_type = "0", role_type = 75200181, position = "195:606:10050,642:606:10000", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 0}
